pragma solidity >=0.8.1;

contract Test{
    struct Unit{
        uint256 orderID;
        address seller;
        address buyer;
        uint256 value;
        uint time;
        bool recieved;
        bool refunded;
    }

    mapping(uint256=>Unit) public products;

    function addUnit(uint256 _orderID,address _seller) payable public{
        require(products[_orderID].orderID==0, "This order is alreday placed");
        products[_orderID]=Unit(_orderID,_seller,msg.sender,msg.value,block.timestamp,false,false);
    }

    function refund(uint256 _id) public{
        require(msg.sender==products[_id].buyer, "This producct is not brought by you");
        require(block.timestamp>products[_id].time+10, "You have to wait before refund");
        require(products[_id].recieved==false, "You have Recieved the Product");
        require(products[_id].refunded==false, "You have already Taken Refund");
        products[_id].refunded==true;
        payable(msg.sender).transfer(products[_id].value);
    }

    function deliveryConfirm(uint _orderID) public {
        require(msg.sender==products[_orderID].buyer, "Only Buyer can confirm the delivery");
        require(products[_orderID].recieved==false, "You have already Recieved the Product");
        require(products[_orderID].refunded==false, "You have already Taken Refund");
        products[_orderID].recieved=true;
        payable(products[_orderID].seller).transfer(products[_orderID].value);
    }
}
